import React from "react";
import Footer from "../../../Components/footer/Footer";
import {
  Box,
  Flex,
  Avatar,
  Link,
  Button,
  Menu,
  MenuButton,
  MenuList,
  MenuItem,
  MenuDivider,
  useDisclosure,
  useColorModeValue,
  Stack,
  Heading,
  useColorMode,
  Center,
  List,
  Card,
  CardBody,
  Icon,
  ListItem,
  Text,
  Divider,
  Grid,
} from "@chakra-ui/react";
import { MoonIcon, SunIcon } from "@chakra-ui/icons";

const AdminMainContent = () => {
  const items = [
    {
      id: 1,
      name: "Item 1",
      description: "Description 1",
      category: "Category 1",
    },
    {
      id: 2,
      name: "Item 2",
      description: "Description 2",
      category: "Category 2",
    },
    {
      id: 3,
      name: "Item 3",
      description: "Description 3",
      category: "Category 3",
    },
    {
      id: 4,
      name: "Item 3",
      description: "Description 3",
      category: "Category 3",
    },
    {
      id: 5,
      name: "Item 3",
      description: "Description 3",
      category: "Category 3",
    },
    {
      id: 6,
      name: "Item 3",
      description: "Description 3",
      category: "Category 3",
    },
    {
      id: 7,
      name: "Item 3",
      description: "Description 3",
      category: "Category 3",
    },
  ];

  return (
    <Box p="2em">
      <Box>
        <Heading mb="2em">Advertisements</Heading>
        <Grid templateColumns="repeat(3, 1fr)" gap={4}>
      {blocks.map((block) => (
        <Box
          key={block}
          bg="blue.500"
          width="100%"
          height="100px"
          borderRadius="md"
        />
      ))}
    </Grid>
      </Box>
      <Footer />
    </Box>
  );
};

export default AdminMainContent;
